import React from "react";
import styles from "./ConnectPage.css";

const ConnectPage = () => {
  return (
    <div>
      <div className={styles.topconnect}>관리자 페이지로 넘어가시겠습니까?</div>

      <div className={styles.bottomconnect}>
        <div className={styles.leftconnect}>
          <img className={styles.WidgetImg} src={imgSrc} alt="아이콘" />
          <div className={styles.title}>{title}</div>
        </div>
        <div className={styles.rightconnect}>고 객</div>
      </div>
    </div>
  );
};

export default ConnectPage;
